function waitForElem(waitFor, callback, minElements = 1, isVariable = false, timer = 10000, frequency = 25) {
	let elements = isVariable ? window[waitFor] : document.querySelectorAll(waitFor);

	if (timer <= 0) return;

	(!isVariable && elements.length >= minElements) || (isVariable && typeof window[waitFor] !== 'undefined')
		? callback(elements)
		: setTimeout(() => waitForElem(waitFor, callback, minElements, isVariable, timer - frequency), frequency);
}

let isGoalTriggeredFromMutation = false;

const asset = {
	celebrationIcon: `
    <svg  class="celebration__svg" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="22" height="22" viewBox="0 0 22 22" fill="none">
    <rect width="22" height="22" fill="url(#pattern2)"/>
    <defs>
    <pattern id="pattern2" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlink:href="#image0_1916_828" transform="scale(0.00625)"/>
    </pattern>
    <image id="image0_1916_828" width="160" height="160" xlink:href="data:image/png;base64,"/>
    </defs>
  </svg>`
};

function getCartItems() {
	let totalInCents = 0;

	document.querySelectorAll('#mini-cart-form .line-item .line-item__content-wrapper .product-item-meta a').forEach(el => {
		if (el.href.includes('geschenkgutschein')) {
			const priceElement = el.closest('.line-item__content-wrapper').querySelector('.line-item__price-list-container .price');
			if (priceElement) {
				const priceText = priceElement.textContent.trim();
				const numericPartWithComma = priceText.match(/[\d,]+/g).join('');
				const numericPart = parseFloat(numericPartWithComma.replace(',', '.'));
				totalInCents += Math.round(numericPart * 100);
			}
		}
	});

	const totalPrice = totalInCents.toFixed(2);
	return Number(totalPrice);
}

function renderProgressBar() {
	let progressBar = `
    <div class="ab__progress-bar__container">
        <div class="ab__progress-bar__container__text">
            <span class="ab__progress-bar__container__text__title">Nur noch <span class="ab__progress-bar__container__text__title__amount">€12,01</span> für</span>
            <span class="ab__progress-bar__container__text__subtitle"> kostenlosen Versand ✌️</span>
        </div>
        
        <div class="ab__progress-bar__container__progress">
            <div class="ab__progress-bar__container__progress__bar">
            </div>
            <div class='ab__progress-bar__container__progress__bar__celebration'>
            ${asset.celebrationIcon}
         <img class="celebration__animation" />
            </div>
            
        </div>
    </div>
    `;

	document.querySelector('.drawer__content') && document.querySelector('.drawer__content').insertAdjacentHTML('afterbegin', progressBar);
}

function fireGoal() {
	gtag('event', 'open_cart', {
		'target_element': 'cart_drawer'
	});
}

function mainJs(body) {
	setTimeout(() => {
		if (!isGoalTriggeredFromMutation) {
			if (document.querySelector('#mini-cart').hasAttribute('open')) {
				fireGoal();
				isGoalTriggeredFromMutation = true;
			}
		}
	}, 100);

	if (document.querySelector('.ab__progress-bar__container') && document.querySelector('.ab__progress-bar__container__progress__bar__celebration')) return;

	document.querySelector('.gwpProgressBar--outer') && document.querySelector('.gwpProgressBar--outer').remove();

	renderProgressBar();

	let cartAmount = document.querySelector('.mini-cart__subtotal >span:nth-child(2)');
	let replacedCartAmount =
		cartAmount &&
		cartAmount.textContent
			.trim()
			.replace('€', '')
			.replace(',', '.');
	if (replacedCartAmount && replacedCartAmount.match(/\./g).length === 2) {
		replacedCartAmount = replacedCartAmount.replace('.', '');
	}
	replacedCartAmount = parseFloat(Number(replacedCartAmount).toFixed(2));
	let cartAmountValueInCents = (replacedCartAmount *= 100);

	cartAmountValueInCents = cartAmountValueInCents.toFixed(2) - getCartItems();
	const freeShippingAmount = 3500;

	const progressBar = document.querySelector('.ab__progress-bar__container__progress__bar');
	const progressBarText = document.querySelector('.ab__progress-bar__container__text');
	const progressBarAmount = document.querySelector('.ab__progress-bar__container__text__title__amount');

	progressBar.style.width = `${(cartAmountValueInCents / freeShippingAmount) * 100}%`;
	progressBarAmount.textContent = `€${(freeShippingAmount - cartAmountValueInCents) / 100}`.replace('.', ',');

	const hasShownCelebration = localStorage.getItem('hasShownCelebration');

	if (cartAmountValueInCents >= freeShippingAmount) {
		progressBar.style.width = '100%';
		progressBarText.classList.add('success');
		document.querySelector('.ab__progress-bar__container').classList.add('success');
		progressBarText.innerHTML = `
        <span class="ab__progress-bar__container__text__title">Glückwunsch, dein <span class="bold">Versand</span> ist jetzt <span class="bold">kostenlos!</span></span>`;

		document.querySelector('.ab__progress-bar__container__progress__bar__celebration').classList.add('show');
		if (!hasShownCelebration) {
			document.querySelector('.celebration__animation').src = 'https://abtest-img-upload.s3.eu-west-2.amazonaws.com/Drip/Apfelband/APF_008/Animation.gif';
			document.querySelector('.celebration__animation').style.visibility = 'visible';
			localStorage.setItem('hasShownCelebration', 'true');
			setTimeout(() => {
				document.querySelector('.celebration__animation').src = '';
				document.querySelector('.celebration__animation').style.visibility = 'hidden';
			}, 3500);
		}
	} else if (cartAmountValueInCents == 0) {
		document.querySelector('.ab__progress-bar__container').style.display = 'none';
		localStorage.removeItem('hasShownCelebration');
	} else {
		localStorage.removeItem('hasShownCelebration');
		document.querySelector('.ab__progress-bar__container__progress__bar__celebration').classList.remove('show');
	}
}

function cartDetect() {
	const target = document.querySelector('#mini-cart');
	const config = { attributes: false, childList: true, subtree: true };
	const callback = function(mutationsList, observer) {
		if (document.querySelector('.drawer__content') && !document.querySelector('.drawer__content').classList.contains('apf__08')) {
			document.querySelector('.drawer__content').classList.add('apf__08');
			waitForElem('#mini-cart', mainJs);
		}
	};

	const observer = new MutationObserver(callback);
	observer.observe(target, config);
}
var old_timestamp = null;
function targettingCartDrawer() {
	const target = document.querySelector('#mini-cart');
	const config = { attributes: true, childList: false, subtree: false };
	const callback = function(mutationsList, observer) {
		if (document.querySelector('#mini-cart').hasAttribute('open')) {
			isGoalTriggeredFromMutation = true;
			if (old_timestamp == null) {
				old_timestamp = 1;
				fireGoal();
				setTimeout(() => {
					old_timestamp = null;
					mainJs();
				}, 1000);
			}
		}
	};
	const observer = new MutationObserver(callback);
	observer.observe(target, config);
}

waitForElem('#mini-cart header', () => {
	setTimeout(() => {
		mainJs();
		cartDetect();
		targettingCartDrawer();
	}, 1000);
});

window.addEventListener('load', event => {
	setTimeout(() => {
		mainJs();
	}, 3000);

	setTimeout(() => {
		mainJs();
	}, 10000);
});
